import React, { useState } from "react";
import ReactDOM from "react-dom";

import "./index.css";
// import App from './App';
// ReactDOM.render(<App/>, document.getElementById('root'));

const initialExpenses = [
  { id: 1, date: new Date(21, 5, 12), title: "Fuel", value: 50000 },
  { id: 2, date: new Date(21, 5, 12), title: "Fuel", value: 50000 },
  { id: 3, date: new Date(21, 5, 12), title: "Fuel", value: 50000 },
  { id: 4, date: new Date(21, 5, 12), title: "Fuel", value: 50000 },
  { id: 5, date: new Date(21, 5, 12), title: "Fuel", value: 50000 },
];

ReactDOM.render(
  <div>
    <div>
      {initialExpenses.map((expense) => (
        <div>
          {expense.title}
          {expense.value}
        </div>
      ))}
    </div>

    <div>
      {initialExpenses[0].title}.<br />
      {initialExpenses[0].value}
    </div>
  </div>,
  document.getElementById("root")
);
